import React from "react"
import { Row, Col } from "react-bootstrap"
import Romeo1 from "../images/Romeo1.jpg"

const Testimonial = () => {
  return (
    <div>
      <Row>
        <Col
          lg={6}
          md={12}
          sm={12}
          style={{ background: "red" }}
          className='ml-auto mr-auto'
        >
          <Row>
            <Col lg={3} md={12} sm={12}>
              <div
                style={{
                  margin: "auto",
                  position: "relative",
                  width: "10vw",
                  height: "10vw",
                  background: "none",

                  overflow: "hidden"
                }}
              >
                <img
                  src={Romeo1}
                  style={{
                    maxWidth: "103%",
                    opacity: "1",
                    marginLeft: "-.5vw"
                  }}
                ></img>
              </div>
            </Col>
            <Col style={{ background: "blue" }}>
              <p style={{ fontSize: "20px", color: "black" }} className='my-6'>
                "Calvin has never failed to impress. His solutions to our
                engineering needs have saved us thousands of dollars..."
              </p>
            </Col>
          </Row>
        </Col>
      </Row>
    </div>
  )
}

export default Testimonial
